import React from 'react';

const AddTest = () => {
    return (
        <div className="container">
            <div className="box">
                <input className="w-100" type="text"/>
                <div>
                    <div>
                        <input name="ans " className="" type="radio"/>
                        <input type="text"/>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default AddTest;
